import React from 'react';

const ImageCards = () => {
  // Array of image file names
  const images = [
    '../assets/images/bricks.jpg',
    'https://www.bing.com/images/search?view=detailV2&ccid=kfruWALF&id=7F5ED8BF5384953D3B42BDFF795754ED11875798&thid=OIP.kfruWALFka0rCSGemc_F0gHaHa&mediaurl=https%3a%2f%2fwww.bhphotovideo.com%2fimages%2fimages2500x2500%2fsamsung_un32f5000afxza_un32f5000_32_1080p_led_918933.jpg&exph=2500&expw=2500&q=tv&simid=608019025938959232&FORM=IRPRST&ck=5DE1B1A08CF928598A6081B6137A538E&selectedIndex=1&itb=0',
    'image3.jpg',
    'image4.jpg',
    'image5.jpg',
    'image6.jpg'
  ];

  return (
    <div className="card-container">
      {images.map((image, index) => (
        <div className="card" key={index}>
          <img src={process.env.PUBLIC_URL + '/' + image} alt={`Image ${index + 1}`} />
        </div>
      ))}
    </div>
  );
}

export default ImageCards;
